import TableScreen from './pages/TableScreen'
import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom'
import { getToday } from './helpers/dateFunction';

function App() {

  const date = getToday()

  return (
    <div>
      <Router>
        <Switch>
          <Route path="/despesas/:date">
            <TableScreen />
          </Route>
          <Redirect to={{pathname:"/despesas/" + date}} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
